{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<\/ul> <h3>\u0414\u043e XIX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/922_%D0%B3%D0%BE%D0%B4\" title=\"922 \u0433\u043e\u0434\">922<\/a>&#160;\u2014 (\u0434\u0430\u0442\u0430 \u0443\u0441\u043b\u043e\u0432\u043d\u0430) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%91%D1%83%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0412\u043e\u043b\u0436\u0441\u043a\u0430\u044f \u0411\u0443\u043b\u0433\u0430\u0440\u0438\u044f\">\u0412\u043e\u043b\u0436\u0441\u043a\u043e\u0439 \u0411\u0443\u043b\u0433\u0430\u0440\u0438\u0438<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BC\" title=\"\u0418\u0441\u043b\u0430\u043c\">\u0438\u0441\u043b\u0430\u043c\u0430<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0440\u0435\u043b\u0438\u0433\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1373_%D0%B3%D0%BE%D0%B4\" title=\"1373 \u0433\u043e\u0434\">1373<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%B4%D0%B7%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1386)\" title=\"\u0412\u0438\u043d\u0434\u0437\u043e\u0440\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1386)\">\u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u044e\u0437\u0435<\/a> (\u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0438\u0439 \u0432 \u043c\u0438\u0440\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1625_%D0%B3%D0%BE%D0%B4\" title=\"1625 \u0433\u043e\u0434\">1625<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0431\u0440\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c\">\u043a\u043e\u0440\u043e\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b I (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u041a\u0430\u0440\u043b\u0430 I \u0421\u0442\u044e\u0430\u0440\u0442\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D0%B5%D1%82%D1%82%D0%B0_%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0413\u0435\u043d\u0440\u0438\u0435\u0442\u0442\u0430 \u041c\u0430\u0440\u0438\u044f \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f\">\u0413\u0435\u043d\u0440\u0438\u0435\u0442\u0442\u044b \u041c\u0430\u0440\u0438\u0438 \u0434\u0435 \u0411\u0443\u0440\u0431\u043e\u043d<\/a>, \u0434\u043e\u0447\u0435\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_IV_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 IV (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u0413\u0435\u043d\u0440\u0438\u0445\u0430 IV<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c\">\u043a\u043e\u0440\u043e\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1655_%D0%B3%D0%BE%D0%B4\" title=\"1655 \u0433\u043e\u0434\">1655<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B3%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0430\u043d\u0433\u043b\u043e-\u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u0430\u043d\u0433\u043b\u043e-\u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%83%D1%81%D1%82%D0%BE%D1%84%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041b\u043e\u0443\u0441\u0442\u043e\u0444\u0442\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u041b\u043e\u0443\u0441\u0442\u043e\u0444\u0442\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435<\/a>, \u043e\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0435\u0435\u0441\u044f \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u0444\u043b\u043e\u0442\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1752_%D0%B3%D0%BE%D0%B4\" title=\"1752 \u0433\u043e\u0434\">1752<\/a>&#160;\u2014 \u041b\u043e\u0433\u0441\u0442\u0430\u0443\u043d\u0441\u043a\u0438\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u043c \u0437\u0435\u043c\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BE%D0%BA%D0%B5%D0%B7%D1%8B\" title=\"\u0418\u0440\u043e\u043a\u0435\u0437\u044b\">\u0438\u0440\u043e\u043a\u0435\u0437\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%B0%D0%B2%D0%B0%D1%80%D1%8B\" title=\"\u0414\u0435\u043b\u0430\u0432\u0430\u0440\u044b\">\u0434\u0435\u043b\u0430\u0432\u0430\u0440\u043e\u0432<\/a> \u043a \u044e\u0433\u0443 \u043e\u0442 \u0440\u0435\u043a\u0438 \u041e\u0433\u0430\u0439\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u044b \u0432 \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0438\u0440\u0433\u0438\u043d\u0438\u044f\">\u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1782_%D0%B3%D0%BE%D0%B4\" title=\"1782 \u0433\u043e\u0434\">1782<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438<\/a> \u0437\u0430\u0444\u0438\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043d \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u0441\u043b\u0443\u0447\u0430\u0439 \u043a\u0430\u0437\u043d\u0438 \u0437\u0430 \u043a\u043e\u043b\u0434\u043e\u0432\u0441\u0442\u0432\u043e (\u043a\u0430\u0437\u043d\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0_%D0%93%D0%B5%D0%BB%D1%8C%D0%B4%D0%B8\" class=\"mw-redirect\" title=\"\u0410\u043d\u043d\u0430 \u0413\u0435\u043b\u044c\u0434\u0438\">\u0410\u043d\u043d\u0430 \u0413\u0435\u043b\u044c\u0434\u0438<\/a>) <\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837_%D0%B3%D0%BE%D0%B4\" title=\"1837 \u0433\u043e\u0434\">1837<\/a>&#160;\u2014 \u0446\u0435\u0441\u0430\u0440\u0435\u0432\u0438\u0447 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447 (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II<\/a>) \u0432\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%8C\" title=\"\u0421\u0438\u0431\u0438\u0440\u044c\">\u0421\u0438\u0431\u0438\u0440\u0438<\/a>. \u0414\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0432 15 (3 \u043f\u043e \u0441\u0442\u0430\u0440\u043e\u043c\u0443 \u0441\u0442\u0438\u043b\u044e) \u0438\u044e\u043d\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B1%D0%BE%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a\">\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a\u0430<\/a>&#160;\u2014 \u043a\u043e\u043d\u0435\u0447\u043d\u043e\u0439 \u0442\u043e\u0447\u043a\u0438 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u044f \u0432 \u0410\u0437\u0438\u0438, \u043d\u0430\u0441\u043b\u0435\u0434\u043d\u0438\u043a \u0441\u043e \u0441\u0432\u0438\u0442\u043e\u0439 \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c \u043f\u043e\u0432\u0435\u0440\u043d\u0443\u043b\u0438 \u043e\u0431\u0440\u0430\u0442\u043d\u043e. \u0421\u0438\u0431\u0438\u0440\u044c \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u043b\u0430 \u043d\u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u043a\u0440\u0430\u0439\u043d\u0435 \u0431\u043b\u0430\u0433\u043e\u043f\u0440\u0438\u044f\u0442\u043d\u043e\u0435 \u0432\u043f\u0435\u0447\u0430\u0442\u043b\u0435\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1843_%D0%B3%D0%BE%D0%B4\" title=\"1843 \u0433\u043e\u0434\">1843<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B8%D1%84%D0%B5%D1%81%D1%82\" class=\"mw-disambig\" title=\"\u041c\u0430\u043d\u0438\u0444\u0435\u0441\u0442\">\u041c\u0430\u043d\u0438\u0444\u0435\u0441\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_I\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f I<\/a> \u043e \u0437\u0430\u043c\u0435\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%81%D0%B8%D0%B3%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D1%80%D1%83%D0%B1%D0%BB%D1%8C\" title=\"\u0410\u0441\u0441\u0438\u0433\u043d\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0440\u0443\u0431\u043b\u044c\">\u0430\u0441\u0441\u0438\u0433\u043d\u0430\u0446\u0438\u0439<\/a> \u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0431\u0443\u043c\u0430\u0436\u043d\u044b\u0445 \u0434\u0435\u043d\u0435\u0436\u043d\u044b\u0445 \u0437\u043d\u0430\u043a\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1